import React from 'react';
import {BrowserRouter as Router } from "react-router-dom";
import NavTabs from "./components/NavTabs";
import Header from "./components/Header"
import Footer from "./components/Footer"
import './App.css';

function App() {
  return (
    <Router>
      <div>
          <Header />
          <NavTabs />
          <Footer />



      </div>
    </Router>
  );
}

export default App;
